INSERT INTO `description` VALUES (8,'Cloud Computing is the next step toward ubiquitous and pervasive computing. Azure is Microsoftâ€™s world-class cloud computing platform used to build, host, and scale web applications and is one of the major strategic thrusts in Microsoftâ€™s Services and Devices Strategy.   Azure is an open platform enabling hosting of both Windows and Linux applications and supports numerous languages such as .NET, Java, Node.js, and PHP.   Come join the Azure team in the Enterprise Partner Group (EPG) as a Cloud Solution Architect and be front and center in our customerâ€™s transformation to cloud-based architectures while at the same time playing an influential role in transforming Microsoft to a Devices & Services company.\r\nAs a Cloud Solution Architect, your primary responsibility with be to move customer workloads to Azure. The CSA is a technical customer facing role that will be accountable for the end-to-end customer cloud deployment experience.   You will own the Azure technical customer engagement including specific implementation projects and/or Proofs of Concept (POCs). \r\nThe ideal candidate will have experience in customer facing roles and had success leading technical and economic value discussions with senior customer executives that drive key decisions and implementation.   The success of this role depends on collaboration with generalists and specialists in the MSFT field and delivery teams (including partners, services, product engineering)  ','5+ years of management and success in consultative / complex sales processes where necessary, managing various stakeholders (Primary:   TDM, Secondary:   BDM) relationships to get consensus on solution / projects.  5+ yearâ€™s design and/or implementation and/or support of highly distributed applications (i.e. having an architectural sense for ensuring availability, reliability, etc.). 2+ yearsâ€™ experience in â€œmigratingâ€ on premise workloads to the cloud.Technical prowess and passion-especially for Windows Azure, modern Application design practices and principles.Oversight experience on major transformation projects and successful transitions to implementation support teams.','In this role, you would be responsible for:.\r\nInterfacing with both the generalists and specialists in the Microsoft sales and delivery teams (including partners, services, Internal Microsoft Product / Service organizations) focused on consumption of the Azure platform in high potential accounts.\r\nExecuting quick technical feasibility and proposal development for moving identified workloads to Azure (i.e. quick and dirty, comfortable with 80-20 rule).\r\nBuilding a technical and security architecture in Azure for the selected apps/workloads.\r\nLead compliance assessments with the customer on designed Azure architecture.\r\nSelecting a migration approach to lift and shift the workloads to Azure or architecting a greenfield development and/or production platform for new applications.\r\nExecuting limited POCs, if necessary. Driving the quality of the onboarding plan (with MCS or partners).\r\nReporting to customer as business objectives / business value conditions are met.\r\nEnsuring plan execution and Azure consumption targets are met.\r\nDocumenting and sharing technical best practices / insights with engineering and the architect community.\r\nKey Qualifications:.   \r\nUnderstanding of cloud computing technologies, business drivers, and emerging computing trends.\r\nProven track record of building technical and business relationships with senior executives and growing wallet share in large or highly strategic accounts.\r\nProven track record of driving decisions collaboratively, resolving conflicts and ensuring follow through.\r\nProblem-solving mentality leveraging internal and/or external resources, where and when needed, to do whatâ€™s right for the customer and for the organization (i.e. think through workarounds, evaluate risk of various deployment options, etc.).\r\nExceptional verbal and written communication.\r\n.Ability to connect technology with measurable business value.\r\nDemonstrated technical thought leadership in customer facing situations\r\n',''),(22,'Are you a motivated, customer-focused individual looking for an inside sales career without the hassle of cold calling?  At GEICO, our stellar reputation and creative marketing campaigns have customers calling us for their insurance needs!  Our insurance sales associates take inbound sales calls from highly interested potential policyholders. \r\nWere looking for sales savvy candidates who are interested in a career with outstanding growth and earnings potential.  After completing our industry-leading, paid sales training, youll need to pass your state licensing exam.  From there, youâ€™ll be a licensed insurance sales professional, equipped to sell an exceptional product.','High school diploma or equivalent. Prior sales experience or strong desire to work in sales . Demonstrated job stability. Solid computer, grammar and multi-tasking skills. Strong attention to detail, time management and decision-making skills. Must be comfortable working in a fast-paced, high volume call center','Monthly bonus potential for meeting sales goals .\r\nRaises and promotions based upon your performance. Professional development opportunities through GEICO University. Coaching and feedback to help you further develop your sales skills . Top performers in Sales are rewarded as part of our Chairmanâ€™s Club Award','1048'),(26,'Imagine not simply writing code, but writing a solution.\r\n\r\n \r\n\r\nImagine not only making a paycheck, but making a difference.\r\n\r\n \r\n\r\nImagine not just having a job, but having a mission.\r\n\r\n \r\n\r\nIf youre a software developer who wants to be part of something truly special, read on. Because StreamLinx, LLC, is a cloud software company dedicated to solving some of the worlds most vexing energy and environmental problems.\r\n\r\n \r\n\r\nFrom our centers in suburban Chicago and suburban Cleveland, we create systems and apps that accelerate the adoption of energy efficiency and clean technologies in commercial and industrial buildings. The energy retrofit boom youve heard so much about? Its real, and the technology that supports it originates right here. Our customers include energy retrofit companies, professional engineering firms, energy service companies, clean power entities, public utilities and electronics distributors. They all share the same objective of reducing energy usage in commercial facilities. And our software speeds that adoption like none other.','C++.\r\nJava.\r\nHTML.\r\nC#','Specific responsibilities include:\r\n\r\nDesign, program, integrate, test and debug assigned software modules.\r\nEffectively estimate project work and time requirements.\r\nCollaborate with other engineering team members to produce high quality applications.\r\nInterface with the customer service team to understand end-user requirements and provide value-added solutions that fulfill customer requirements.\r\nPerform unit testing on individually designed components; send work to QA for testing.','12345'),(27,'We are looking for a product owner to join our Imaging-Consumer Retail Business team. As the Consumer Software Product Owner you will be setting the direction for the consumer experience at photo ordering kiosks located at retail sites around the globe. You will be responsible for timely launch of new, high-quality products, features and innovations that drive revenue generation. Were interested in a self-directed, motivated person with a passion for success and who is never satisfied with the status quo.','Demonstrated experience in identifying customer and business requirements, communicating those into a product vision, and rallying the execution team around that vision.\r\nAbility to work with cross functional teams (Marketing, Finance, UI, Visual Design,\r\nEngineering, Customer Service).\r\nPassionate about customer experience.\r\nKnowledge of software development and architecture.\r\nExperience managing product backlog and backlog prioritization along with gathering requirements and developing them into use cases, user stories, epics, or themes.','Work closely with the other teams to identify and prioritize high-impact, revenue driving, projects and features that have short and long term business impact.\r\nReview and conduct research, competitive analysis, customer feedback, market sizing, technology assessment and ROI analysis and modeling.\r\nAdvocates for the customers, always focusing on the needs and benefits of the user.\r\nWork closely with team members in UI, design and engineering groups to provide them accurate, in-depth and concise stories, use-cases and requirements.','34567');
